While empty types exist already in Rust today, for example in the form of enum Foo {}, most Rust users will not be directly familiar with them, so this RFC provides an explanation of the properties these types hold (and that ! will hold). They never exist at runtime , because there is no way to create one. Code that handles them cannot execute , because there is no value that it could execute with. Therefore, having an empty type in scope is a static guarantee that a piece of code will never be run. They represent the return type of functions that don't return . For a function that never returns, such as std::process::exit, the set of all values it may return is the empty set. That is to say, the type of all values it may return is the type of no inhabitants, ie. Never or anything isomorphic to it. Similarly, they are the logical type for expressions that never return to their caller such as break, continue and return. They can be converted to any other type . To specify a function A -> B we need to specify a return value in B for every possible argument in A. For example, an expression that converts bool -> T needs to specify a return value for both possible arguments true and false: let foo: &'static str = match x { true => "some_value", false => "some_other_value",
}; Likewise, an expression to convert () -> T needs to specify one value, the value corresponding to (): let foo: &'static str = match x { () => "some_value",
}; And following this pattern, to convert Never -> T we need to specify a T for every possible Never. Of which there are none: let foo: &'static str = match x { }; Reading this, it may be tempting to ask the question "what is the value of foo then?". Remember that this depends on the value of x. As there are no possible values of x it's a meaningless question and besides, the fact that x has type Never gives us a static guarantee that the match block will never be executed. Here's some example code that uses Never. This is legal rust code that you can run today. use std::process::exit; // Our empty type
enum Never {} // A diverging function with an ordinary return type
fn wrap_exit() -> Never { exit(0);
} // we can use a `Never` value to diverge without using unsafe code or calling
// any diverging intrinsics
fn diverge_from_never(n: Never) -> ! { match n { }
} fn main() { let x: Never = wrap_exit(); // `x` is in scope, everything below here is dead code. let y: String = match x { // no match cases as `!` is uninhabited }; // we can still use `y` though println!("Our string is: {}", y); // we can use `x` to diverge diverge_from_never(x)
} This RFC proposes that we allow ! to be used directly, as a type, rather than using Never (or equivalent) in its place. Under this RFC, the above code could more simply be written. use std::process::exit; fn main() { let x: ! = exit(0); // `x` is in scope, everything below here is dead code. let y: String = match x { // no match cases as `Never` has no variants }; // we can still use `y` though println!("Our string is: {}", y); // we can use `x` to diverge x
}

