However, this change to fallback is not generally sound in the presence of unsafe code that is present in the wild today. The following is a piece of example code that was previously OK, but with the proposed change has undefined behavior. It's a stripped down example -- the code is already unsound in the sense that unconstrained_return must only be called with valid T, but in practice code like this exists and does not cause UB (as it never gets instantiated with an incorrect T) with today's compiler. fn unconstrained_return<T>() -> Result<T, String> { let ffi: fn() -> T = std::mem::transmute(some_pointer); Ok(ffi())
} fn foo() { let _a = match unconstrained_return::<_>() { Ok(a) => a, Err(s) => panic!("failed to run"), };
} The match here has type ?M and the two arms have types ?T and !, as panic! has type ! with these changes. ?T here is effectively unconstrained, so it falls back to ! with the proposed change to type inference. As a result, unconstrained_return's call to ffi() has a return type of !, which means that the compiler is free to assume that the function does not return. Since ffi() in practice does return, this leads to UB. So we cannot simply change fallback in all cases. We propose an algorithm which indicates whether it is safe to fallback to !. For each inference variable still present during fallback (i.e. those which are unconstrained), we look at the relationships between these inference variables to determine whether to keep the fallback to () or fallback to !. We construct a directed graph where the vertices are inference variables, and add edges ?A -> ?B if ?A is coerced into ?B. Let D be the set of type variables ?X which were created as a result of the coercion of ! -> ?X being proposed. These can arise from functions returning ! or loop {} expressions, which can coerce into any type. For each type variable ?T, we fallback to: ! if the variable is dominated in the graph by the set D (that is, there is no path from a non-diverging type variable to it). () otherwise. The intuition here is that variables reachable only from diverging type variables must be in dead code, but if they are also reachable from some non-diverging type variable, they may be in live code, and so fallback to ! is unsound.

